CREATE FUNCTION public.delete_user_content() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Delete all posts (including comments) by the deleted user
  DELETE FROM posts WHERE user_id = OLD.id;
  -- Delete all reactions by the deleted user
  DELETE FROM reactions WHERE user_id = OLD.id;
  RETURN OLD;
END;
$$;


